import{_ as e,o as r,c as a,O as n}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 18.2-111 Embezzlement deemed larceny; indictment.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-111.md","filePath":"vacode/18.2-111.md"}'),t={name:"vacode/18.2-111.md"},o=n('<h1 id="§-18-2-111-embezzlement-deemed-larceny-indictment" tabindex="-1">§ 18.2-111 Embezzlement deemed larceny; indictment. <a class="header-anchor" href="#§-18-2-111-embezzlement-deemed-larceny-indictment" aria-label="Permalink to &quot;§ 18.2-111 Embezzlement deemed larceny; indictment.&quot;">​</a></h1><p>If any person wrongfully and fraudulently use, dispose of, conceal or embezzle any money, bill, note, check, order, draft, bond, receipt, bill of lading or any other personal property, tangible or intangible, which he shall have received for another or for his employer, principal or bailor, or by virtue of his office, trust, or employment, or which shall have been entrusted or delivered to him by another or by any court, corporation or company, he shall be guilty of embezzlement. Proof of embezzlement shall be sufficient to sustain the charge of larceny. Any person convicted hereunder shall be deemed guilty of larceny and may be indicted as for larceny and upon conviction shall be punished as provided in § <a href="http://law.lis.virginia.gov/vacode/18.2-95/" target="_blank" rel="noreferrer">18.2-95</a> or § <a href="http://law.lis.virginia.gov/vacode/18.2-96/" target="_blank" rel="noreferrer">18.2-96</a>.</p><p>Code 1950, § 18.1-109; 1960, c. 358; 1975, cc. 14, 15; 1979, c. 349; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0555" target="_blank" rel="noreferrer">555</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0733" target="_blank" rel="noreferrer">733</a>.</p>',3),i=[o];function l(c,d,s,h,m,f){return r(),a("div",null,i)}const b=e(t,[["render",l]]);export{_ as __pageData,b as default};
